The Cartesian product of two sets A and B, denoted as A x B, is the set of all possible ordered pairs (a, b) where a is an element of A and b is an element of B.

First, let's find A x B:

A x B = {(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)}

Now, let's find B x A:

B x A = {(4, 1), (4, 2), (4, 3), (5, 1), (5, 2), (5, 3)}

As we can see, A x B and B x A are not equal because the ordered pairs in each set are different. In A x B, the first element of each ordered pair comes from set A, while in B x A, the first element of each ordered pair comes from set B.
